import Calendar from 'react-calendar'
import { useState } from 'react';

const Calander = () => {
    const [value, onChange] = useState(new Date());

    return (
      <div>
        <Calendar
          onChange={onChange}
          value={value}
        />
      </div>
    );
}
 
export default Calander;
